import axios from 'axios';
import React, { useState } from 'react';
import Listfrech from './Listfrech';

const List = () => {
  const[allpost,setallpost]=useState([]);
  axios.get("https://jsonplaceholder.typicode.com/posts").then(res=>{
    setallpost(res.data);
  })
  return (
    <div className='flex'>
      <div className="grid lg:grid-cols-4 md:grid-cols-3 grid-cols-1 md:m- mx-auto justify-evenly gap-x-8 gap-y-5 flex-wrap">
        {allpost.slice(0, 10).map((data) => (
          <Listfrech
            key={data.id}
            title={data.title}
            body={data.body}
            id={data.id}
          />
        ))}
      </div>
    </div>
  );
  
};

export default List;
